import React from "react";
import ReactDOM from "react-dom";
import App from "./App.js";
import "./index.css";
import { BookContextProvider } from "./store/book-context";
import { BrowserRouter } from "rea";

ReactDOM.render(
  <BookContextProvider>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </BookContextProvider>,
  document.getElementById("root")
);
